import './Burron.css';

const Button = (props) => {

    return (
      <div>
        {props.state === 0 ? <button onClick={props.start}>Start</button> : ""}

        {props.state === 1 ? 
        <div><button onClick={props.stop}>Stop</button>
        <button onClick={props.reset}>Reset</button></div>
         : ""}

        {props.state === 2 ? <div><button onClick={props.resume}>Resume</button>
        <button onClick={props.reset}>Reset</button></div>
         : ""}

{/* 
